import React from 'react';
import './style.css';
import { FaInstagram, FaLinkedin, FaGithub, FaEnvelope } from 'react-icons/fa';

const Footer = () => {
  return (
    <footer className='footer'>
      <div className='footer-content'>
        <div className='footer-section'>
          <h3>Sobre</h3>
          <p>Este é o portfólio de Karla Ferreira, uma desenvolvedora apaixonada por tecnologia.</p>
        </div>
        <div className='footer-section'>
          <h3>Contato</h3>
          <ul className='contact-list'>
            <li><a href="mailto:kferreira_@outlook.com"><FaEnvelope /> kferreira_@outlook.com</a></li>
            <li><a href="https://www.linkedin.com/in/karla-ferreira-rural/"><FaLinkedin /> LinkedIn</a></li>
            <li><a href="https://github.com/kfrural"><FaGithub /> GitHub</a></li>
            <li><a href="https://www.instagram.com/kf.rural"><FaInstagram /> Instagram</a></li>
          </ul>
        </div>
      </div>
      <div className='footer-bottom'>
        <p>&copy; 2024 Kfrural. Todos os direitos reservados.</p>
        <p>Desenvolvido por Karla Ferreira</p>
      </div>
    </footer>
  );
}

export default Footer;
